/**默认打开的alert*/
var flavr=function(content,modal,autoclose,timeout){
	/**默认模态提示*/
	if(modal==undefined){
		modal=true;
	}
	/**默认不自动关闭*/
	if(autoclose==undefined){
		autoclose=false;
	}else if(autoclose==true&&timeout==undefined){
		/**自动关闭默认延时2s*/
		timeout=2000;
	}
	return new $.flavr({ 
		modal : modal, 
		autoclose : autoclose,
		timeout : timeout,
		content :content,
	});
}

var Flavr = {
		tips : function(flag){
			switch (flag) {
			case "notSame":
				return this.fprompt("当前信息已发生改变，不允许进行操作，请刷新页面后重试！");
				break;
			case "prohibit":
				return this.fprompt("当前信息不允许进行操作，请刷新页面后重试！");
				break;
			case "same":
				return this.fprompt("当前信息未发生改变，不予提交！");
				break;
			case "noProcess":
				return this.fprompt("当前服务审批流程尚未创建，请联系您的负责人！");
				break;
			case "undefined":
				return this.fprompt("未知错误！");
				break;
			default:
				break;
			}
		},
		//content		提示语
		//confirmEvent	通过的回调事件
		//param1		通过的参数数组
		//cancelEvent	退回的回调事件
		//param2		退回的参数数组
		fprompt : function(content){//定时提示
			return new $.flavr({ 
				modal : false,
				autoclose : true,
				timeout : 3000,
				content :content,
				buttons :{},
				overlay :false
			});
		},
		falert : function(content){//需确认的提示
			return new $.flavr({
				content :content
			});
		},
		fconfirm : function(content,confirmEvent,cancelEvent){//需确认的事件（带回调）
			return new $.flavr({
				content :content,
				dialog : 'confirm',
				onConfirm : function(){
					confirmE(confirmEvent);
				},
				onCancel : function(){
					confirmE(cancelEvent);
				},
			});
			function confirmE(Event){
				Event();
			}
		},
		fpromptpon : function(content,position){//居中展示
			return new $.flavr({ 
				modal : false,
				autoclose : true,
				timeout : 3000,
				content :content,
				buttons :{},
				position:position,
				overlay :false
			});
		}
	}